import React from "react";

export default function RadioGroup(props) {
  const boxs = props.datas.map(o => (
    <label key={o.value}>
      <input
        type="radio"
        name={props.name}
        checked={props.value === o.value}
        onChange={e => props.onChange(o.value)}
      />
      {o.label}
    </label>
  ));

  return <div>{boxs}</div>;
}
